import React from 'react'
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

import maine from '../images/OceanMaine.jpg'
import sickSara from '../images/SickSara.jpg'

class Main extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      sheetLoaded: false
    }
  }

  componentDidMount() {
    fetch('https://sheets.googleapis.com/v4/spreadsheets/14OsbtSgGtA911j16Y_QjX6P_etYEJ4sahge0iQn8mcw/values:batchGet?key=AIzaSyDp3E9ot4dN7F-h8r_Ic6YCAv0P3EQ-eS4&ranges=Sheet1&majorDimension=ROWS')
    .then((resp) => {
      resp.json((data) => {
        debugger;
      })
    })
  }
  render(){
  let importAll = (r) => {
    return r.keys().map(r);
  }

  let images = importAll(require.context('../images', false, /\.(png|jpe?g|svg)$/));

  let carouselImages = images.map((image, index) => {
    return <div><img src={image} id={index}/><p className="legend">TEST</p></div>
  })

    return (
      <div>
        <Carousel infiniteLoop={true} autoPlay={true} >
            {carouselImages}
        </Carousel>
      </div>
    )
  }
}

export default Main
